    "2013-03-16T00:40:38.199432",nt"name": "classification-of-geothermal-systems-a-possible-scheme",nt"isopen":
    false,nt"url": null,nt"notes": "At the request of the United States Department
    of Energy, the author was asked by the Geothermal Energy Association (Washington,
    D.C.) to prepare a white paper on the subject (in connection with a new national
    assessment of geothermal resources). This paper offers a possible scheme in which
    geothermal resources are classified into seven categories based on temperature:
    non-electrical grade (100C), very low temperature (100C to 150C), low temperature(150C
    to 190C), moderate temperature (190C to 230C), high temperature (230C to 300C),
    ultra high temperature (300C), and steam fields (approximately 240C with steam as
    the only mobile phase). In the first four classes, liquid water is the mobile phase
    in the reservoir; in the high and ultra high temperature reservoirs, the mobile
    fluid phase is either liquid or a liquid-vapor mixture.",nt"license_title":
